import JobsList from "./Components/open";
import React from "react";
export default function App() {
  // const [loading, setLoading] = useState(true);
  const [error, setError] = React.useState(undefined);
  const [jobdata, setJobData] = React.useState([]);

  React.useEffect(() => {
    fetch("https://refertest.pythonanywhere.com/job/openings")
      .then((res) => res.json())
      .then((json) => {
        console.log(json);
        setJobData(json);
        console.log(jobdata);
        // setLoading(false);
      })
      .catch((err) => {
        console.log(err);
        setError(err.message);
        // setLoading(false);
      });
  });
  console.log(typeof jobdata);
  const list = jobdata.map((item) => {
    return <JobsList key={item.id} {...item} />;
  });

  return <div className="App">{list}</div>;
}
